SELECT DISTINCT timestamp,body,attributes,resource FROM logs WHERE ((timestamp >= toDateTime64('1970-07-18 18:51:50', 9)) AND (timestamp <= toDateTime64('1970-07-18 19:08:30', 9))) AND ((JSONExtract(attributes, 'label', 'String') = 'value') OR (JSONExtract(resource, 'label', 'String') = 'value')) AND NOT ((positionUTF8(body, 'line') > 0)) AND (hex(span_id) IN ('deaddead', 'aaaabbbb')) AND (hex(trace_id) = unhex('deaddead')) LIMIT 1000